var EventName=Datajo.EventName;describe("EventName",function(){var n,t;beforeEach(function(){n=document.createElement("div"),t=document.createElement("form")}),describe("extract",function(){it("should throw exception if action has not been provided",function(){expect(function(){return EventName.extract(undefined,n)}).toThrow(),expect(function(){return EventName.extract(null,n)}).toThrow()}),it("should throw exception if HTML element has not been provided",function(){expect(function(){return EventName.extract({},undefined)}).toThrow(),expect(function(){return EventName.extract({},null)}).toThrow()}),it("should return 'click' event when action doesn't specify it",function(){expect(EventName.extract({},n)).toEqual("click"),expect(EventName.extract({event:undefined},n)).toEqual("click"),expect(EventName.extract({event:null},n)).toEqual("click"),expect(EventName.extract({event:""},n)).toEqual("click"),expect(EventName.extract({event:"   "},n)).toEqual("click")}),it("should throw exception if event name has not been recognized",function(){expect(function(){return EventName.extract({event:"invalid event"},n)}).toThrow()}),it("should ignore characters case",function(){expect(EventName.extract({event:"CLIck"},n)).toEqual("click"),expect(EventName.extract({event:"   cLIck "},n)).toEqual("click")}),it("should recognize 'click' event",function(){expect(EventName.extract({event:"click"},n)).toEqual("click")}),it("should recognize 'load' event",function(){expect(EventName.extract({event:"load"},n)).toEqual("load")}),it("should recognize 'submit' event",function(){expect(EventName.extract({event:"submit"},t)).toEqual("submit")}),it("should throw exception if 'submit' event has been applied to a HTML element different than <form>",function(){expect(function(){return EventName.extract({event:"submit"},n)}).toThrow()})})})